import { Component, inject } from '@angular/core';
import { CommonModule } from '@angular/common';
import { RouterModule } from '@angular/router';
import { Router } from '@angular/router';

// Angular Material
import { MatSidenavModule } from '@angular/material/sidenav';
import { MatToolbarModule } from '@angular/material/toolbar';
import { MatIconModule } from '@angular/material/icon';
import { MatButtonModule } from '@angular/material/button';
import { MatListModule } from '@angular/material/list';
import { MatMenuModule } from '@angular/material/menu';

// AuthService
import { AuthService } from '../auth/auth.service';

@Component({
  selector: 'app-dashboard-layout',
  standalone: true,
  imports: [
    CommonModule,
    RouterModule,
    MatSidenavModule,
    MatToolbarModule,
    MatIconModule,
    MatButtonModule,
    MatListModule,
    MatMenuModule
  ],
  template: `
    <mat-sidenav-container class="sidenav-container">
      <!-- Ajustamos el ancho -->
      <mat-sidenav #drawer mode="side" opened class="custom-sidenav">
  <div class="logo-container">
    <img src="data:image/png;base64," alt="Logo" class="logo">
  </div>
  <mat-nav-list class="nav-list">
    <a mat-list-item routerLink="/dashboard" routerLinkActive="active">
      <mat-icon>dashboard</mat-icon>
      <span>Dashboard</span>
    </a>
    <mat-list-item (click)="toggleCompras()" style="cursor: pointer;">
    <mat-icon>shopping_cart</mat-icon>
    <span>Compras</span>
    <mat-icon style="margin-left:auto">
      {{ comprasExpandido ? 'expand_less' : 'expand_more' }}
    </mat-icon>
  </mat-list-item>

  <!-- Sub-items, solo si comprasExpandido es true -->
  <mat-nav-list class="sub-list" *ngIf="comprasExpandido">
    <a mat-list-item routerLink="/compras/abiertas" routerLinkActive="active">
      <span>Abiertas</span>
    </a>
    <a mat-list-item routerLink="/compras/cerradas" routerLinkActive="active">
      <span>Cerradas</span>
    </a>
  </mat-nav-list>
    <a mat-list-item routerLink="/proveedores" routerLinkActive="active">
      <mat-icon>business</mat-icon>
      <span>Proveedores</span>
    </a>
  </mat-nav-list>
</mat-sidenav>


      <mat-sidenav-content>
        <mat-toolbar color="primary">
          <button mat-icon-button (click)="drawer.toggle()">
            <mat-icon>menu</mat-icon>
          </button>
          <span class="toolbar-title">ALANDRI SRL</span>

          <span class="spacer"></span>

          <button mat-button [matMenuTriggerFor]="userMenu">
            <mat-icon>account_circle</mat-icon>
            {{ nombreUsuario }}
          </button>
          <mat-menu #userMenu="matMenu">
            <button mat-menu-item (click)="logout()">
              <mat-icon>logout</mat-icon>
              Salir
            </button>
          </mat-menu>
        </mat-toolbar>

        <div class="content">
          <router-outlet></router-outlet>
        </div>
      </mat-sidenav-content>
    </mat-sidenav-container>
  `,
  styles: [`
    .sidenav-container {
      height: 100vh;
    }

    .custom-sidenav {
      width: 200px; /* ms estrecho */
      display: flex;
      justify-content: center;
      padding-top: 20px;
    }

    .nav-list {
      display: flex;
      flex-direction: column;
      gap: 10px;
    }

    .nav-list a {
      display: flex;
      align-items: center;
      gap: 10px;
      justify-content: center; /* centramos el texto e cono */
    }

    .toolbar-title {
      margin-left: 8px;
      font-weight: bold;
      font-size: 1.2rem;
    }

    .spacer {
      flex: 1 1 auto;
    }

    .content {
      padding: 16px;
    }

    .custom-sidenav {
  width: 180px; /* un poco ms estrecho */
  display: flex;
  flex-direction: column;
  align-items: center;
  padding-top: 20px;
  background-color: #d3d3d3; /* azul claro tipo Material */
}
// .mat-toolbar {
//   background-color: #d3d3d3; /* mismo gris claro */
//   color: #000; /* texto negro para contraste con gris */
// }

.logo-container {
  width: 100%;
  display: flex;
  justify-content: center;
  margin-bottom: 20px;
}

.logo {
  width: 150px;   /* aumenta el ancho */
  height: 150px;  /* aumenta la altura */
  object-fit: contain; /* mantiene la proporcin */
}


.nav-list {
  display: flex;
  flex-direction: column;
  gap: 10px;
  width: 100%;
}

.nav-list a {
  display: flex;
  align-items: center;
  gap: 10px;
  justify-content: flex-start;
  padding-left: 16px;
  color: #0d47a1; /* azul ms oscuro para los conos/textos */
  font-weight: 500;
}
.sub-list {
  padding-left: 20px; /* indentacin del submen */
  display: flex;
  flex-direction: column;
  gap: 5px;
}

.sub-list a {
  font-size: 0.95rem; /* opcional: un poco ms pequeo */
}

  `]
})
export class DashboardLayoutComponent {
  private router = inject(Router);
  private auth = inject(AuthService);

  nombreUsuario = this.auth.getNombreUsuario();

  logout() {
    this.auth.logout();
    this.router.navigate(['/login']);
  }

   comprasExpandido = false;

  toggleCompras() {
    this.comprasExpandido = !this.comprasExpandido;
  }
}
